import React, { useState, useEffect } from 'react';
import { ReactP5Wrapper } from '@p5-wrapper/react';
import './App.css';

function App() {
  // 時計表示用のstate
  const [time, setTime] = useState(new Date());

  useEffect(() => {
    const timer = setInterval(() => {
      setTime(new Date());
    }, 1000);
    return () => clearInterval(timer);
  }, []);

  // p5スケッチ（背景のみ一度だけ描画、アニメーションなし）
  const sketch = (p5) => {
    let pixelSize = 4;
    let cols, rows;

    p5.setup = () => {
      p5.createCanvas(p5.windowWidth, p5.windowHeight);
      cols = Math.floor(p5.width / pixelSize);
      rows = Math.floor(p5.height / pixelSize);
      p5.noStroke();

      // 空のグラデーション
      for (let y = 0; y < Math.floor(rows * 0.6); y++) {
        let t = y / (rows * 0.6);
        let c = p5.lerpColor(p5.color(90,180,255), p5.color(0,120,255), t);
        p5.fill(c);
        for (let x = 0; x < cols; x++) {
          p5.rect(x * pixelSize, y * pixelSize, pixelSize, pixelSize);
        }
      }

      // 雲（大きなふわふわ）
      p5.fill(255,255,255,230);
      for (let i = 0; i < 8; i++) {
        let cx = p5.width * (0.1 + 0.1 * i);
        let cy = 60 + 30 * (i%3);
        let r = 40 + 30 * (i%3);
        for (let j = 0; j < 20; j++) {
          let angle = p5.TWO_PI * j / 20;
          let rx = cx + p5.cos(angle) * r + p5.random(-8,8);
          let ry = cy + p5.sin(angle) * r/2 + p5.random(-8,8);
          p5.ellipse(rx, ry, 32, 18);
        }
      }

      // 海のグラデーション
      for (let y = Math.floor(rows * 0.6); y < rows; y++) {
        let t = (y - rows * 0.6) / (rows * 0.4);
        let c = p5.lerpColor(p5.color(80,180,255), p5.color(0,60,180), t);
        p5.fill(c);
        for (let x = 0; x < cols; x++) {
          p5.rect(x * pixelSize, y * pixelSize, pixelSize, pixelSize);
        }
      }

      // 海の反射（白いドット）
      p5.fill(255,255,255,180);
      for (let i = 0; i < 200; i++) {
        let rx = p5.random(p5.width);
        let ry = p5.random(p5.height*0.62, p5.height*0.75);
        if (p5.random() > 0.7) {
          p5.rect(rx, ry, pixelSize, pixelSize);
        }
      }

      // ヨット
      let boatX = p5.width * 0.18;
      let boatY = p5.height * 0.7;
      p5.fill(255);
      p5.triangle(boatX, boatY, boatX+18, boatY, boatX+9, boatY-32);
      p5.fill(200,200,220);
      p5.rect(boatX+5, boatY, 18, 6, 2);
    };

    p5.draw = () => {
      p5.noLoop(); // 1回だけ描画してループ停止
    };

    p5.windowResized = () => {
      p5.resizeCanvas(p5.windowWidth, p5.windowHeight);
      cols = Math.floor(p5.width / pixelSize);
      rows = Math.floor(p5.height / pixelSize);
      p5.redraw(); // リサイズ時のみ再描画
    };
  };

  // 時計表示用フォーマット関数
  const formatTime = (date) => {
    const hours = date.getHours().toString().padStart(2, '0');
    const minutes = date.getMinutes().toString().padStart(2, '0');
    const seconds = date.getSeconds().toString().padStart(2, '0');
    return `${hours}:${minutes}:${seconds}`;
  };

  const formatDate = (date) => {
    const year = date.getFullYear();
    const month = (date.getMonth() + 1).toString().padStart(2, '0');
    const day = date.getDate().toString().padStart(2, '0');
    const weekdays = ['日', '月', '火', '水', '木', '金', '土'];
    const weekday = weekdays[date.getDay()];
    return `${year}年${month}月${day}日 (${weekday})`;
  };

  return (
    <div className="App">
      <ReactP5Wrapper sketch={sketch} />
      <div className="clock-overlay">
        <div className="time">{formatTime(time)}</div>
        <div className="date">{formatDate(time)}</div>
      </div>
    </div>
  );
}

export default App;
